import './ContactMe.css';

function ContactMe() {
  return (
    <section id="contact-info" class="contact-me">
    <div class="info">
        <p>
            Contact Info
        </p>    
        <address>
            18200 Blanco Springs <br />
            San Antonio TX 78258 <br />
            PH: (830)765-5453 <br />
            Email: <a href="mailto:prisc.montalvo@gmail.com">Prisc.montalvo@mail.com</a>
        </address>
    </div>
</section>
  );
}

export default ContactMe;
